import './App.css';
import ArticlesClosing from '../src/components/ArticlesClosing';
import {BrowserRouter as Router, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes path="/articles" component={ArticlesClosing}></Routes>
      </Router>
    </div>
  );
}

export default App;
